import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookF, faLinkedinIn, faTwitter } from '@fortawesome/free-brands-svg-icons';

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <div style={styles.socialIcons}>
        <a href="https://www.facebook.com/" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faFacebookF} style={styles.icon} />
        </a>
        <a href="https://www.linkedin.com/" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faLinkedinIn} style={styles.icon} />
        </a>
        <a href="https://twitter.com/" target="_blank" rel="noopener noreferrer">
          <FontAwesomeIcon icon={faTwitter} style={styles.icon} />
        </a>
      </div>
      <div style={styles.copyRight}>Â© 2023 All rights reserved.</div>
    </footer>
  );
};

const styles = {
  footer: {
    position: 'fixed',
    left: 0,
    bottom: 0,
    width: '100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: '#3f3f3f',
    padding: '30px 0',
  },
  socialIcons: {
    display: 'flex',
    justifyContent: 'center',
    marginBottom: '20px',
  },
  icon: {
    fontSize: '24px',
    margin: '0 10px',
    color: '#555',
    cursor: 'pointer',
    transition: 'all 0.3s ease',
  },
  copyRight: {
    fontSize: '14px',
    color: '#888',
  },
};

export default Footer;
